import React, { Component } from "react";
import "./App.css";
import Product from "./component/Product";

class App extends Component {
  render() {
    var products = [
      {
        id: 1,
        name: "Apple Iphone 6 Plus",
        price: "15000000",
        image:
          "https://didongviet.vn/pub/media/catalog/product//i/p/iphone-6-plus-16gb-lock-my-like-new-didongviet-2.jpg",
        status: true,
      },
      {
        id: 1,
        name: "Samsung galaxy s7",
        price: "18000000",
        image:
          "https://sudospaces.com/mobilecity-vn/images/2019/12/galaxy-s7-gold.jpg",
        status: false,
      },
      {
        id: 1,
        name: "Nokia 6",
        price: "8000000",
        image:
          "https://didongviet.vn/pub/media/catalog/product//n/o/nokia-6-den-didongviet_2.jpg",
        status: true,
      },
    ];

    let elements = products.map((product, index) => {
      return (
        <Product
          key={product.id}
          name={product.name}
          price={product.price}
          image={product.image}
        />
      );
    });

    return (
      <div>
        <nav className="navbar navbar-inverse">
          <a className="navbar-brand" href="/#">
            Props
          </a>
        </nav>
        <div className="container">
          <div className="row">
            <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
              {elements}
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
